import React from 'react';
import BarChartV from './src/BarChart';
import ChartsPage from './src/LineChart';
import PieChartV from './src/PieChart';


function App() {
  return (
    <div>
     <PieChartV/>
     <BarChartV/>
     <ChartsPage/>
    </div>
  );
}

export default App;
